import React from 'react';
import style from './LoginForm.module.css';

const LoginForm = (props) => {

    return (
        <form className={style['login-form']}>
            <div className={style['login-email']}>
            <label>email</label>
            <input type="text" name="email" onChange={props.onInputChange} required />
            </div>
            <div className={style['login-password']}>
            <label>password</label>
            <input type="password" name="password" onChange={props.onInputChange} required />
            </div>
            <div className={style['login-error']}>Register here {props.loginError}</div>
            <button className={style['login-btn']} type="submit" onClick={props.onSubmit}>Login</button>
            <span className={style['signup-link']} onClick={props.onSignUpButtonClick}>Sign-up</span>
        </form>
    );
};

export default LoginForm;
